import React, { Component } from "react";
import "./App.css";
import { HashRouter, Route, Routes, Navigate , Link  } from "react-router-dom";
import Event_Task from "./components/Event_Task/Event_Task";
import Create_Event_Task from './components/Create_Event_Task/Create_Event_Task'

class App extends Component {
    render() {
        return (
            <HashRouter>
                <div className="App">
                    <div className="App_Navbar">
                                    <Link to='/Create_Event_Task' replace='true'>create task</Link>
                        <input
                            className="App_Navbar_Plus_Button"
                            type="button"
                            value="+"
                            onClick={() => {
                                return <Navigate to="/Create_Task"></Navigate>;
                            }}
                            />
                    </div>
                </div>
                <Routes>
                    <Route path="/"></Route>
                    <Route path="/Create_Event_Task" element={<Create_Event_Task/>}></Route>
                </Routes>
            </HashRouter>
        );
    }
}

export default App;
